n on October 14, 2021. May be an image of one or more people and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"Sometimes in life you meet people who you know instantly are going to impact you in a way that will leave you at a loss for words to describe where you would be without them. That\u2019s how I feel about my good friend Rory. The work that we have done together and the perspective he has given me has opened my eyes to so many things that I will never be able to fully express. I am so grateful to have him in my life and so many other amazing friends and family. \n\nUnfortunately most of the time it takes whenever we fall down to really appreciate and see who is going to be there to lift us up. The support I have had through the last journeys of my life has left me where I struggle to find the words to express how grateful I am for those people. For those who are struggling, I hope that you are as lucky as I am to have such special people in your life. To those who are prospering, I hope that you can take the time each day to look around you at all the special people in your life, and don\u2019t forget to say thank you and show your people how much you value them. \n\nThank you Rory for the tremendous impact you have had on me and my life."}}]},"edge_media_to_comment":{"count":27},"comments_disabled":false,"taken_at_timestamp":1634263793,"edge_liked_by":{"count":909},"edge_media_preview_like":{"count":909},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/245394063_131360439236727_429991953583885720_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=cg0WfzlmSuoAX8dTjN1\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=6abd499a145d95c8e66ccbc8ee8f02ce\u0026oe=6198DDAB\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/245394063_131360439236727_429991953583885720_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u
